let text = $json["message"];

// Remove ```json formatting
text = text.replace(/```json|```/g, "").trim();

// Parse the JSON array
const arr = JSON.parse(text);

// Filter only relevant=true
const filtered = arr
  .filter(item => item.relevant === true)
  .map(item => item.subdomain);

// Return a single item with list
return [{
  json: {
    subdomains: filtered
  }
}];

