const text = items[0].json.data;

const lines = text.split("\n");

const subs = lines.map(line => {
    try {
        const url = line.replace(/^https?:\/\//, '');
        return url.split("/")[0];
    } catch {
        return null;
    }
}).filter(Boolean);

const subdomains = [...new Set(subs)];

return [{
  json: {
    subdomains
  }
}];

let allSubdomains = [];

for (const item of items) {
  const values = Object.values(item.json).flat();

  for (let value of values) {
    if (typeof value === 'string') {
      const parts = value
        .split(/[\n,]+/)
        .map(v => v.trim())
        .filter(v => v);
      allSubdomains.push(...parts);
    }
  }
}

const unique = [...new Set(allSubdomains)];

return [
  {
    json: {
      subdomains: unique
    }
  }
];

