const items = $input.all();

// Regex para validar subdominios (sin asterisco al inicio)
const validRegex = /^(?!\*)(?:[a-zA-Z0-9-]+\.)+[a-zA-Z]{2,}$/;

// Extrae y filtra los subdominios desde el input dinÃ¡mico
const allSubdomains = items
  .flatMap(item => {
    const data = item.json.subdomains || item.json.subdomain || item.json.domain || "";
    return data
      .toString()
      .split(/\s*,\s*|\s+/)
      .map(str => str.trim().replace(/:\d+$/, ""));
  })
  .filter(str => validRegex.test(str));

// Genera la salida como texto con saltos de lÃ­nea
const txtOutput = allSubdomains.join("\n");

return [{ json: { subdomain: txtOutput } }];

const raw = $json["Passive Results"];   // Replace "data" with your actual field name

// Split by newline and clean extra stuff like "[Google Web Server]"
const cleaned = raw
  .split('\n')
  .map(x => x.replace(/\[.*?\]/g, '').trim()) // remove bracket info
  .filter(x => x.length > 0);

return cleaned.map(item => ({ subdomain: item }));
